As I’ve been navigating through my healing process I’ve been exploring the world of dating. Admittedly, at 33 years of age until this point I’ve dated not truly knowing how to. I’ve never truly gone through a vetting process. I’d meet the guy, spend a few months of getting to know him and skip to “exclusively” dating. But as I’m learning there is a process to having a healthy dating life that could lead to a successful committed relationship! 
-
@love_mcpherson is currently coaching me through “Exploratory Dating”. I found this process to be eye opening for me and wanted to share. What are your thoughts?
